-- task 11 extra dataset --

drop table if exists family;
drop table if exists gotrones_db;

create table family(
  member_id int, -- id of family member
  name text -- name of family member
);


create table gotrones_db(
  gotrone_id int, -- id of current (go)trone
  parent_gotrone_id int, -- id of go(go)trone for current (go)trone
  member_id int, -- if of captain of this (go)trone
  gotrone_type text, -- type, will be like "(Go)trone"
  power int -- power of current (go)trone
);
